);



CREATE TABLE FastCommerce.dbo.State (
    Id int IDENTITY(1,1) NOT NULL,
    UfId INT          NOT NULL,
    Name     VARCHAR(50) NOT NULL,
    Uf       CHAR(2)  NOT NULL,
